function userReducer(state = {name: ""}, action) {
    console.log('State from userReducer:', state)
    console.log('Action from userReducer:', action)

    switch (action.type) {
        case 'LOGIN_USER':
            return state
        default:
            return state
    } 
}

export default userReducer
